import { Grid, Typography } from '@material-ui/core';
import React from 'react'
import { ILandingpageValues } from '../../_interfaces/ILandingpageValues';

interface IProps{
    values: ILandingpageValues
}

const GreetingComponent: React.FC<IProps> = (props) =>{
    const {values} = props
    
    return(
        <Grid justifyContent='center' container>
            <Grid item>
                <Typography variant='h4'>{values.greeting}</Typography>
            </Grid>
            <Grid item>
                <Typography variant='h4'>{values.buttler}</Typography>
            </Grid>
        </Grid>
    )
}

export default GreetingComponent
